import css from 'styled-jsx/css';

export default 
<style>
{`
body {
    margin:10px;
    padding:5px;
    color:#669;
}
header {
    font-size:64pt;
    font-weight:bold;
    text-align:right;
    letter-spacing:-8px;
    color:#ddddff;
    margin:-30px 5px;
}
footer {
    color:#a9a9a9;
    font-size:10pt;
    text-align:right;
    margin:50px 0px 10px 0px;
    position: relative;
    bottom: 10px;
    right: 10px;
    left: 10px;
}
h1 {
    font-size:22pt;
    font-weight:bold;
    text-align:left;
    letter-spacing:0px;
    color:#77a;
    margin:-10px 0px 50px 0px;
}
p {
    margin:0px;
    color:#669;
    font-size:16pt;
}  
hr {
    margin:25px 0px;
}
tr {
    margin:0px;
}
th {
    font-size:14pt;
    font-weight:100;
    text-align:left;
    padding:0px 5px;
    margin:0px;
}
td {
    font-size:14pt;
    font-weight:plain;
    text-align:left;
    padding:0px 20px;
    margin:0px;
    border:solid 1px #99c;
    border-radius: 1em;
    background-color:#e0ffff;
}
table {
    margin: 30px 30px;
    padding: 10px;
    border: medium inset #99c;
}
`}
</style>;
